import './App.css';
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import Looby from './pages/Looby';
import Mycontract from './pages/Mycontract';
import Myprofolio from './pages/Myprofolio';
import AddCase from './pages/AddCase';
import CaseDetail from './pages/PostDetail';


const router = createBrowserRouter([
  {
    path: "/",
    element: <Looby />,
  },
  {
    path: "/Mycontract",
    element: <Mycontract />,
  },
  {
    path: "/Myprofolio",
    element: <Myprofolio />,
  },
  {
    path: "/post/:id",
    element: <CaseDetail />,
  },
  {
    path: "/add-post",
    element: <AddCase />,
  }

]);

function App() {
  return (
    <div className="w-screen min-h-screen bg-yellow-800/5 text-yellow-900">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
